import React, { useState } from 'react';

const Application = () => {
  const [isModalOpen, setIsModalOpen] = useState(false);

  // Function to open the modal
  const openModal = () => {
    setIsModalOpen(true);
  };

  // Function to close the modal
  const closeModal = () => {
    setIsModalOpen(false);
  };

  return (
    <div>
      <h2 style={{ marginLeft: 300 }}>𝑨𝒑𝒑𝒍𝒊𝒄𝒂𝒕𝒊𝒐𝒏𝒔</h2>
      <br />
      <table class="table-bordered" style={{ width: 1000, height: 200, marginLeft: 300 }}>
        <thead>
          <tr>
            <th style={{ padding: 20 }}>Date</th>
            <th style={{ padding: 20 }}>Name</th>
            <th style={{ padding: 20 }}>RegisterNumber</th>
            <th style={{ padding: 20 }}>Subject</th>
            <th style={{ padding: 20 }}>Approval</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td style={{ padding: 20 }}>01-02-2023</td>
            <td style={{ padding: 20 }}>Harish V</td>
            <td style={{ padding: 20 }}>111721203022</td>
            <td style={{ padding: 20 }}>Smart India Hackathon</td>
            <td><center><b style={{ backgroundColor: '#67fa3e', padding: 5, borderRadius: 5 }}>View</b></center></td>
          </tr>
          <tr>
            <td style={{ padding: 20 }}>01-02-2023</td>
            <td style={{ padding: 20 }}>Harish V</td>
            <td style={{ padding: 20 }}>111721203022</td>
            <td style={{ padding: 20 }}>Smart India Hackathon</td>
            <td><center><b style={{ backgroundColor: '#67fa3e', padding: 5, borderRadius: 5 }} onClick={openModal}>View</b></center></td>
          </tr>
          <tr>
            <td style={{ padding: 20 }}>01-02-2023</td>
            <td style={{ padding: 20 }}>Harish V</td>
            <td style={{ padding: 20 }}>111721203022</td>
            <td style={{ padding: 20 }}>Smart India Hackathon</td>
            <td><center><b style={{ backgroundColor: '#67fa3e', padding: 5, borderRadius: 5 }}>View</b></center></td>
          </tr>
        </tbody>
      </table>

      {/* Modal */}
      {isModalOpen && (
        
          <div className="modal-content" style={{ position: 'absolute',left:600,top:100, backgroundColor: 'white', border:'1px solid black',padding: 20 , width: 600, height: 500}}>
            <span className="close" onClick={closeModal} style={{ position: 'absolute', top: 10, right: 10, cursor: 'pointer' ,color:'black'}}>&times;</span>
            <h2>𝑺𝒖𝒎𝒎𝒂𝒓𝒚</h2>
            <p>I hope this message finds you well. Unfortunately, I am writing to request a leave of absence from [start date] to [end date] due to a sudden bout of fever. My doctor has advised rest and medication for a speedy recovery. I assure you that I will stay in touch and provide any necessary updates during my absence. Thank you for your understanding and consideration</p>
          <div style={{display:'flex'}}><button style={{padding:5,borderRadius:5,backgroundColor:'#67fa3e',border:0}}>𝑨𝒄𝒄𝒆𝒑𝒕</button><button style={{marginLeft:400,padding:5,borderRadius:5,backgroundColor:'#fc7968',border:0,width:120}}>𝑹𝒆𝒋𝒆𝒄𝒕</button></div>
          </div>
      
      )}
    </div>
  );
}

export default Application;
